// src/pages/MerchantDashboard/MerchantDashboard.jsx

import React from "react";

const MerchantDashboard = () => {
  return (
    <div style={{padding: 32}}>
      <h2>Merchant Dashboard</h2>
      <p>This is where merchant actions, orders, and analytics will appear.</p>
    </div>
  );
};

export default MerchantDashboard;
